import React from 'react'
import { useState } from "react";
import Box from "@mui/material/Box";
import AppBar from "@mui/material/AppBar";
import Toolbar from '@mui/material/Toolbar';
import Typography from '@mui/material/Typography';
import Button from '@mui/material/Button';
import IconButton from '@mui/material/IconButton';
import MenuIcon from '@mui/icons-material/Menu';

import { useTheme } from '@mui/material/styles';

const Navbar = () => {
  const theme = useTheme();

  console.log(theme);

  return (
    <Box sx={{ flexGrow: 1 }}>
      <AppBar component="nav"  position="fixed" sx={{ background: "red" }}>
        <Toolbar>
          <Typography variant="h6" component="div" sx={{ flexGrow: 1 }}>
            GreenCells
          </Typography>
          <Box>
            <Button color="inherit" sx={{ textTransform: "Capitalize", marginRight: "1rem" }}>ÃŽnregistrare</Button>
            <Button color="inherit" sx={{ textTransform: "Capitalize" }}>Conectare</Button>
          </Box>
        </Toolbar>
      </AppBar>
    </Box>
  )
}

export default Navbar
